pragma solidity >=0.8.0 <0.9.0;

import "./DiceGameFactory.sol"; 
contract DiceGame is DiceGameFactory{ 


  function setScore(uint _gameId, uint8 _score) public {
    Game storage game = games[_gameId];
    require( game.bet[userToIndex[msg.sender]] > uint(0) , "Bet has not been placed yet");
    game.scores[userToIndex[msg.sender]] = _score;
  }

  function resetScores(uint _gameId) internal {
      Game storage game = games[_gameId];
      for ( uint i; i < game.scores.length; i++) {
          game.scores[i] = uint8(100);
      }
  }

  function placeBet() public payable {
    uint gameId = userToGameId[msg.sender];
    uint userIndex;
    Game storage game = games[gameId];
    for (uint i; i < game.players.length; i++) {
      if (game.players[i] == msg.sender){
        userIndex = i;
      }
    }
    if (  game.bet.length == 0 ) {
        game.bet.push(msg.value);
    }
    else {
        game.bet[userIndex] += msg.value;
    }
  }

  function getTotalBet(uint _gameId) public view returns(uint){
    uint totalBet;
    for (uint i; i < games[_gameId].players.length; i++) {
      if (i <= games[_gameId].bet.length - 1) {
        totalBet += games[_gameId].bet[i];
      }
    }
    return totalBet;
  }

  function checkBet(uint _gameId) public view returns(uint) {
    return getTotalBet(_gameId);
  }

  function gameOver(uint _gameId) public view returns(bool){
    Game storage game = games[_gameId];
    for (uint i; i < game.bet.length; i++) {
      if (game.bet[i] <= uint(0) || game.scores[i] == uint8(100)){
        return false;
      }
    }
    return true;
  }

  function payWinner(uint _gameId) public {
    require(gameOver(_gameId), "Game has not ended");
    uint winner;
    Game storage game = games[_gameId];
    uint lowestScore = 1000;
    uint8[] memory scores = game.scores;
    for (uint i; i < scores.length; i++) {
      if (scores[i] < lowestScore) {
        winner = i;
        lowestScore = scores[i];
      }
    }
    uint totalBet = getTotalBet(_gameId);
    for (uint i; i < games[_gameId].players.length; i++) {
      if (i <= games[_gameId].bet.length - 1) {
        games[_gameId].bet[i] = 0;
      }
    }
    resetScores(_gameId);
    emit GameSet(game, "game over");
    payable(game.players[winner]).transfer(totalBet);
  }
  }","keccak256":"0x4d29c70080749c4fd63d55ac5ce6a3177824a407268131f2f41e999937763b5b","license":"MIT"},"contracts/DiceGameFactory.sol":{"content":"// SPDX-License-Identifier: MIT
